import React, { Component } from "react";
import "./Tasks.css";
class Options2 extends Component {
  render() {

    return (
      <div className="Tasks">


          <div className="Card">
            <div className="Task">
            Today  
            </div>
            <div className="Task">
            Tomorrow
            </div>
            <div className="Task">
            Someday
            </div>
          </div>

      </div>
    );
  }
}

export default Options2;
